calculates.calculation:
(function() {
	var dobYear = data('dob_year');
	var dobMonth = data('dob_month') || 1;
	var dobDay = data('dob_day') || 1;
	var manualAge = data('dob_enter_age') || 0;

	if (!!dobYear) {
		var dob = new Date(dobYear, dobMonth - 1, dobDay);
		var now = new Date();

		return (now - dob) / 1000 * 60 * 60 * 24 * 365.25;
	} else {
		return manualAge;
	}
})()

